import constants from "./Workout.Constants";
import { getConfigProperty } from "../../../settings";
import { makeGetCall } from "../../../utils/Api";

const WORKOUT_LIST = getConfigProperty("workoutList");

/**
 * #desc getWorkoutListRequest - request sent for fetching workout list data
 * @return {object} - Returns type and response
 */

export function getWorkoutListRequest(req) {
  return {
    type: constants.GET_WORKOUT_LIST_REQUEST,
    req
  };
}

/**
 * #desc getWorkoutListSuccess - notifies when request sent callback
 * @return {object} - Returns type and response
 */

export function getWorkoutListSuccess(response) {
  return {
    type: constants.GET_WORKOUT_LIST_SUCCESS,
    response
  };
}

/**
 * #desc getWorkoutListFailure - notifies when request failed
 * @return {object} - Returns type and response
 */

export function getWorkoutListFailure(exception) {
  return {
    type: constants.GET_WORKOUT_LIST_FAILURE,
    exception
  };
}

/**
 * @desc getWorkOutList to get list of workouts
 * @param {string} url - url to get the list from
 * @return {object} - Returns promise
 */

export function getWorkoutList(url = WORKOUT_LIST) {
  return (dispatch, getState) => {
    dispatch(getWorkoutListRequest(true));
    return makeGetCall(url, getState)
      .then(res => res.json())
      .then(json => {
        dispatch(getWorkoutListSuccess(json));
        dispatch(getWorkoutListRequest(false));
      })
      .catch(ex => {
        dispatch(getWorkoutListFailure(ex));
        dispatch(getWorkoutListRequest(false));
      });
  };
}

/**
 * @desc Workoutlist Actions and Reducer constants
 * @constant
 * @type {object}
 * @default
 */

const constants = {
  GET_WORKOUT_LIST_REQUEST: "GET_WORKOUT_LIST_REQUEST",
  GET_WORKOUT_LIST_SUCCESS: "GET_WORKOUT_LIST_SUCCESS",
  GET_WORKOUT_LIST_FAILURE: "GET_WORKOUT_LIST_FAILURE"
};

export default constants;

import { connect } from "react-redux";
import { withRouter } from "react-router";
import { bindActionCreators } from "redux";
import Workout from "./Workout";
import * as workoutAction from "./Workout.Actions";

export default withRouter(
  connect(
    state => ({
      workoutListData: state.workoutReducer.workoutListData
    }),
    dispatch => ({
      workoutActions: bindActionCreators(workoutAction, dispatch)
    })
  )(Workout)
);

import constants from "./Workout.Constants";

/**
 * Declare initalState for workout container
 * @constant
 * @param {object} listQuery - Declare the initialState value for the listQuery
 * @default
 * @example const initialState = {
   listQuery : {}
  }
 */

const initialState = {
  workoutListData: {}
};

/**
 * Reducer function for list
 * @param {object} state - contains state object for the reducer list
 * @param {object} action - contains type and its data
 */

function reducer(state = initialState, action) {
  switch (action.type) {
    case constants.GET_WORKOUT_LIST_SUCCESS: {
      return Object.assign({}, state, {
        workoutListData: action.response
      });
    }
    case constants.GET_WORKOUT_LIST_FAILURE: {
      return Object.assign({}, state, initialState);
    }
    default:
      return state;
  }
}

export { initialState };
export default reducer;

